      | 30173 -> { ItemTypeData.id= 30173; name= "OLD Legion Engineering - Capacitor Regeneration Matrix"; published= false; description= "This subsystem is obsolete and has been replaced by newer technology    Using the same technology that can be found inside the ancient Sleeper race's guardian drones, this regeneration matrix greatly improves the recharge rate of a Tech III vessel's capacitor. Even though empire-based designs have achieved this effect for centuries, the way in which this system works is markedly different.     Rather than the usual tweaking of capacitor fluid formulas, this design simply triples the number of nanotubes inside – something not possible until the recent influx of fullerene polymers from which this subsystem is made. This results in a drastic increase in the speed and efficiency of energy flow throughout a ship. The quicker that the surplus power can be redirected back to the core, the more that it can contribute to the overall recharge rate of the capacitor.    Subsystem Skill Bonus:   5% bonus to capacitor recharge time per level.  "; marketGroupId= None; groupId= 955; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 4; value= 1200000.000000 }; { DogmaAttributeValueData.attributeId = 2696; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 9; value= 40.000000 }; { DogmaAttributeValueData.attributeId = 11; value= 1290.000000 }; { DogmaAttributeValueData.attributeId = 18; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 277; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 1431; value= -5.000000 }; { DogmaAttributeValueData.attributeId = 283; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 161; value= 40.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 500.000000 }; { DogmaAttributeValueData.attributeId = 422; value= 3.000000 }; { DogmaAttributeValueData.attributeId = 182; value= 30539.000000 }; { DogmaAttributeValueData.attributeId = 55; value= 415000.000000 }; { DogmaAt