      | 30270 -> { ItemTypeData.id= 30270; name= "Central System Controller"; published= true; description= "Still fully intact and operational, this device stands as a testament to the ancient Sleeper's impressive scientific achievements. Although thousands of years old, the technology inside it is not only comparable to modern electronic designs, but in some cases even exceeds it.     Central system controllers lie at the heart of a starship's electronics systems. They are responsible for coordinating the flow of information between various analyzers and control nodes, monitoring subsystems, and ensuring they receive the appropriate supply of electrical power. Tackling such complex tasks simultaneously (and with near-zero latency) demands immense processing power and faultless, error-free programming. Traditionally, a CSC would comprise a significant portion of the cost in a starship's electronics systems, but the fullerene-based Sleeper designs have provided breakthroughs in the efficiency of circuitry and presented new and improved methods for increasing computational accuracy. The end result is a drastically reduced cost for top-of-the-line performance.   "; marketGroupId= Some(1862); groupId= 966; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 9; value= 20.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 161; value= 0.010000 } |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 30464 -> { ItemTypeData.id= 30464; name= "Metallofullerene Plating"; published= true; description= "Metallofullerene plating is used to protect the connective joins in hull and subsystem structures so that Tech III vessels can be taken apart and put back together endlessly, all without the risk of wear. Mechanical engineers first attempted to create the plating using plutonium metallofullerenes, but it was quickly discovered that even miniscule amounts of them had a sizeable impact on ship mass. When integrated into armor plating in larger amounts, they also risked turning the vessel into a giant warhead, something even less desirable.     A solution was finally found. Tiny amounts of metallofullerenes would be integrated in conjunction with far larger quantities of graphene nanoribbons and then coated in powdered C-540 graphite. This process allowed the material to maintain structural durability whilst keeping mass down. The last and most ingenious addition was to incorporate fulleroferrocene into the metal beneath layers of electromechanical hull sheeting. This had the effect of turning the normally dangerous explosive reactions into kinetic energy, which could then be used to supplement the power supply to local nanoassemblers."; marketGroupId= Some(1147); groupId= 964; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 5.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 726; value= 100.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 } |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 5.000000; portionSize= 1; radius= 1.000000; volume= 5.000000 } |> Some
