      | 47730 -> { ItemTypeData.id= 47730; name= "Unstable Warp Scrambler Mutaplasmid"; published= true; description= "This bioadaptive mutaplasmid tool is designed to interface with and alter targeted, short-range warp field scrambling devices. As such this mutaplasmid could be used to mutate the performance characteristics of most warp scramblers.    Triglavian bioadaptive technology makes extensive use of engineered colonies of extremophilic bacteria, that are used to grow, harvest and adapt various resources found in Abyssal Deadspace. Artificial colonizing plasmids integrated into specialist tools used for direct adaptation of technology can be found in Triglavian caches in various stages of development. These mutaplasmids can be used to alter the characteristics of a wide variety of equipment types, depending on the strain and the bioadaptive tool with which they are integrated.    The mutaplasmid colony integrated into this bioadaptive tool is highly unstable, with a high rate of reproduction and mutation. The mutational benefits of using this mutaplasmid are potentially very high but the risks are also extreme.  "; marketGroupId= Some(2441); groupId= 1964; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 1.000000; portionSize= 1; radius= 1.000000; volume= 1.000000 } |> Some
      | 47827 -> { ItemTypeData.id= 47827; name= "Gravid Medium Energy Neutralizer Mutaplasmid"; published= true; description= "This bioadaptive mutaplasmid tool is designed to interface with and alter energy charge neutralization devices. As such this mutaplasmid could be used to mutate the performance characteristics of most energy neutralizers in the correct size class.    Triglavian bioadaptive technology makes extensive use of engineered colonies of extremophilic bacteria, that are used to grow, harvest and adapt various resources found in Abyssal Deadspace. Artificial colonizing plasmids integrated into specialist tools used for direct adaptation of technology can be found in Triglavian caches in various stages of development. These mutaplasmids can be used to alter the characteristics of a wide variety of equipment types, depending on the strain and the bioadaptive tool with which they are integrated.    The mutaplasmid colony integrated into this bioadaptive tool appears to be mature and reproducing at a healthy rate. The mutational benefits and risks of using this mutaplasmid are within relatively balanced bounds."; marketGroupId= Some(2454); groupId= 1964; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 1.000000; portionSize= 1; radius= 1.000000; volume= 1.000000 } |> Some
